import React, { useState } from 'react';
import "./Login.css";
import { useNavigate } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEye } from '@fortawesome/free-solid-svg-icons';


const Login = () => {
  const navigate = useNavigate();

  const handleSignupClick = () => {
      navigate('/signup');
  };

  const [isPasswordVisible, setIsPasswordVisible] = useState(false);

  const togglePasswordVisibility = () => {
    setIsPasswordVisible(!isPasswordVisible);
  };

  return (
    <div>
      <button className="register-button-login-page"onClick={handleSignupClick}>Kaydol</button>
      <div className="login-container">
        <div className="login-box">
          <h1 className="login-title">MentUp’a Giriş Yap</h1>
          <form>
            <div className="input-group">
              <label htmlFor="email">E-posta</label>
              <input type="email" id="email" placeholder="johndoe@example.com" required />
            </div>
            <div className="input-group">
              <label htmlFor="password">Şifre</label>
              <div className="password-wrapper-login-page">
                <input
                  type={isPasswordVisible ? "text" : "password"}
                  id="password"
                  placeholder="********"
                  required
                />
                <button
                  type="button"
                  className="toggle-password"
                  onClick={togglePasswordVisibility}
                >
                  <FontAwesomeIcon icon={faEye} style={{fontSize: '18px' }}/>
                </button>
              </div>
            </div>
            <div className="options">
              <label className="remember-me">
                <input type="checkbox" /> Beni Hatırla
              </label>
              <a href="#" className="forgot-password">Şifremi unuttum?</a>
            </div>
            <button type="submit" className="login-button-login-page">GİRİŞ YAP</button>
          </form>
        </div>
      </div>
    </div>

  );
};

export default Login;
